import React, { useState } from 'react';
import { View, Button, Text, ScrollView } from 'react-native';
import styles from './styles';
import { stickies } from '../../../assets/stickies';

function Landing({ user }) {

    return (<>
        <ScrollView>
            <View style={styles.container}>
                <View>
                    <Text style={styles.header}>Welcome, {user.name}!</Text>
                </View>

                <View style={styles.stickiesContainer}>
                    {stickies.map(({ message, author, date }) => (<>
                        <View style={styles.stickyContainer}>
                            <Text style={styles.stickyMessage}>{message}</Text>
                            <Text style={styles.stickyAuthor}>Sticky by {author}</Text>
                            <Text style={styles.stickyDate}>Published at {date}</Text>
                        </View>
                    </>))}
                </View>
            </View>
        </ScrollView>
    </>)
}

export default Landing;
